DROP DATABASE IF EXISTS tonersales;
CREATE DATABASE tonersales;
USE tonersales;

CREATE TABLE Globals (
    Name VARCHAR(255),
    Value VARCHAR(255)
);


CREATE TABLE `users` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
	`username` VARCHAR(255) NULL DEFAULT NULL,
	`email` VARCHAR(255) NULL DEFAULT NULL,
	`password` VARCHAR(255) NULL DEFAULT NULL,
	`googleId` VARCHAR(255) NULL DEFAULT NULL,
	`facebookId` VARCHAR(255) NULL DEFAULT NULL,
	`token` VARCHAR(255) NULL DEFAULT NULL,
	`role` TINYINT(4) NULL DEFAULT NULL,
	PRIMARY KEY (`id`)
)
COLLATE='latin1_swedish_ci'
ENGINE=InnoDB
AUTO_INCREMENT=4
;


CREATE TABLE `products` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
	`active` BIT(1) NULL DEFAULT NULL,
	`name` VARCHAR(255) NULL DEFAULT NULL,
	`taxid` INT(11) NULL DEFAULT NULL,
	`price` DOUBLE NULL DEFAULT NULL,
	`wprice` DOUBLE NULL DEFAULT NULL,
	`quantity` INT(11) NULL DEFAULT NULL,
	`weight` DOUBLE NULL DEFAULT NULL,
	`url` TEXT NULL DEFAULT NULL,
	`reference` VARCHAR(50) NULL DEFAULT NULL,
	`image` VARCHAR(255) NULL DEFAULT NULL,
	`pages` INT(11) NULL DEFAULT NULL,
	`printers` TEXT NULL DEFAULT NULL,
	`shortdescription` TEXT NULL DEFAULT NULL,
	`description` TEXT NULL DEFAULT NULL,
PRIMARY KEY (`id`)
)
COLLATE='latin1_swedish_ci'
ENGINE=InnoDB
AUTO_INCREMENT=1679
;



CREATE TABLE Payment_method (
    id int NOT NULL AUTO_INCREMENT,
    description VARCHAR(255),
    PRIMARY KEY(id)
    
);


CREATE TABLE Shipping_method (
    id int NOT NULL AUTO_INCREMENT,
    description VARCHAR(255),
    PRIMARY KEY(id)
);

CREATE TABLE `orders` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
	`shipping_id` INT(11) NULL DEFAULT NULL,
	`userId` INT(11) NULL DEFAULT NULL,
	`products` TEXT NULL,
	`total` DOUBLE NOT NULL,
	`payment_meth_id` INT(11) NULL DEFAULT NULL,
	PRIMARY KEY (`id`),
	INDEX `shipping_id` (`shipping_id`),
	INDEX `payment_meth_id` (`payment_meth_id`),
	INDEX `userId` (`userId`),
	CONSTRAINT `orders_ibfk_1` FOREIGN KEY (`shipping_id`) REFERENCES `shipping_method` (`id`),
	CONSTRAINT `orders_ibfk_2` FOREIGN KEY (`payment_meth_id`) REFERENCES `payment_method` (`id`),
	CONSTRAINT `orders_ibfk_3` FOREIGN KEY (`userId`) REFERENCES `users` (`id`)
)
COLLATE='latin1_swedish_ci'
ENGINE=InnoDB
;


CREATE TABLE Order_Products (
	product_id int,
	order_id int,
	FOREIGN KEY (product_id) REFERENCES Products(id),
	FOREIGN KEY (order_id) REFERENCES Orders(id)
);


